const Cart = ({cart,setcart}) => {
    return ( 
        <div className="cart">
            {cart.map((data)=>(
                <div className="carty">
                    <div>
                        <img src={data.thumbnail} alt="" />
                    </div>
                    <div>
                        <h1>{data.title}</h1>
                    </div>
                </div>
            ))}
        </div>
     );
}
 
export default Cart;
